	('231924354', 'BS Information Technology', '1st year', '', '', 'Erica Jean S. Abadinas', 'Face-to-face', 'No', '', 'No', '', 'Yes', 'Yes', 'Home', 'Yes', 'Yes', 'Personal(Car, Bike, Motorcycle, etc.)', '', 'Less than 30 minutes', 'Excited and Happy', 'Personal(Car, Bike, Motorcycle, etc.)', '', '30 minutes to 1 hour', 'Tired and Lazy', '"High Demand for Skills: The technology sector is constantly growing, and there is a high demand for professionals with skills in CS/IT. This can lead to excellent job prospects and opportunities. Versatility: CS/IT skills are applicable across various industries. Whether it''s finance, healthcare, entertainment, or any other field, technology plays a crucial role, providing you with a broad range of career options. Innovation and Creativity: CS/IT fields are dynamic and allow for constant innovation. If you enjoy solving problems, creating new applications, or exploring cutting-edge technologies, this field can be highly satisfying. Global Opportunities: Technology is a global industry, and skills acquired in CS/IT are transferable across borders. This opens up opportunities to work in different countries and experience diverse cultures. Competitive Salaries: Jobs in CS/IT often come with competitive salaries. As technology becomes more integral to business operations, organizations are willing to invest in skilled professionals who can contribute to their success.'),
